    false,nt"url": null,nt"notes": "This annual narrative report for Ouray
    National Wildlife Refuge outlines Refuge accomplishments during the 1975 fiscal
    year.  The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, predators, rodents, mammals, raptors, fish, reptiles, and diseases-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, and vegetation control. Resource management is outlined;
    topics include grazing, haying, and timber removal. The public relations section
    of the report describes Refuge participation, hunting, and safety.",nt"license_title":
